INSERT INTO `post` (`id`, `created_at`, `updated_at`, `content`, `image`, `overview`, `published_at`, `title`, `user_id`) VALUES
	(3, '2024-11-22 09:54:20.454074', '2024-11-28 11:00:58.853636', 'Dove sono nati gli spaghetti alla carbonara? Il Vicolo della Scrofa, per chi conosce Roma, è una delle stradine più caratteristiche e ricche di simboli. Proprio in una trattoria di questa strada, da cui il nome del vicolo, pare sia stata realizzata la prima carbonara, nel 1944. La storia più attendibile su questo primo piatto, infatti, racconta l\'incontro tra gli ingredienti a disposizione dei soldati americani e la fantasia di un cuoco romano. Il risultato fu il prototipo degli spaghetti alla carbonara: uova, bacon (poi guanciale) e formaggio. Man a mano la ricetta è evoluta fino a quella che tutti conosciamo oggi e possiamo apprezzare a casa di amici romani veraci (e voraci!), nelle trattorie come nei ristoranti stellati della Capitale, in tutta Italia e all\'estero, nelle innumerevoli versioni: con o senza pepe, con un tuorlo per persona o l\'aggiunta di almeno un uovo intero, con guanciale o pancetta tesa. Il condimento per la carbonara si prepara in una manciata di minuti, come tante altre prelibatezze romane (pensiamo alla cacio e pepe!). Pensate che occorrono soltanto guanciale speziato tagliato a striscioline, una crema dorata a base di tuorli (nella nostra versione) e tanto Pecorino romano grattugiato al momento. Nella sua semplicità e nella ricchezza delle materie prime, la ricetta degli spaghetti alla carbonara è parente stretta di altri due capisaldi della cucina genuina italiana: l\'amatriciana e la pasta alla gricia! Strizza l\'occhio anche alla pasta alla zozzona, un piatto robusto che unisce il meglio delle preparazioni di base della cucina laziale. ', NULL, 'La ricetta degli spaghetti alla carbonara è tipica romana, apprezzata e replicata in tutto il mondo! Scopri come fare la carbonara perfetta!', '2024-11-27', 'Spaghetti alla Carbonara', 8),
	(4, '2024-11-22 09:59:44.412175', '2024-11-25 11:00:33.864156', 'Per preparare il tiramisù preparate il caffé con la moka per ottenerne 300 g, poi zuccherate a piacere (noi abbiamo messo un cucchiaino) e lasciatelo raffreddare in una ciotolina bassa e ampia. Separate le uova dividendo gli albumi dai tuorli, ricordando che per montare bene gli albumi non dovranno presentare alcuna traccia di tuorlo. Montate i tuorli con le fruste elettriche, versando solo metà dose di zucchero. Non appena il composto sarà diventato chiaro e spumoso, e con le fruste ancora in funzione, potrete aggiungere il mascarpone, poco alla volta. Incorporato tutto il formaggio avrete ottenuto una crema densa e compatta ; tenetela da parte. Pulite molto bene le fruste e passate a montare gli albumi. Quando saranno schiumosi versate il restante zucchero un po’ alla volta. Si consiglia di consumare il tiramisù preparato con uova fresche entro la giornata o conservare al massimo per 1 giorno in frigo, in un contenitore ermetico. Se utilizzate uova pastorizzate anche 2-3 giorni. Si può congelare per circa 2 settimane in freezer. Potete aggiungere a piacimento del cioccolato fondente a scaglie o delle gocce di cioccolato.', NULL, 'Il tiramisù non ha bisogno di presentazioni, almeno il classico! Crema di tuorli e mascarpone, strato di savoiardi inzuppati nel caffè, cacao amaro a spolvero.', '2024-11-27', 'Tiramisù', 8),
	(5, '2024-11-22 10:01:24.671955', '2024-11-25 11:00:33.894273', 'La pasta alla gricia è considerata l’antenata dell\'amatriciana, con cui ha in comune l’utilizzo del guanciale e del Pecorino romano. A differenza dell\'amatriciana, ricetta originale, non prevede il sugo di pomodoro poiché la sua origine sarebbe addirittura antecedente alla sua importazione in Europa. Si dice infatti che la ricetta della gricia sia stata inventata dai pastori laziali che, con i pochi ingredienti a disposizione, preparavano una pietanza tanto semplice quanto sostanziosa. Una pasta alla gricia fatta a regola d’arte deve risultare cremosa e saporita con il solo ausilio del formaggio e dell’acqua di cottura: noi abbiamo scelto i rigatoni per raccogliere questo gustoso condimento ma sarà perfetto anche un formato lungo come bucatini o tonnarelli! Si consiglia di consumare la pasta alla gricia appena pronta. In alternativa potete conservarla in frigorifero per un giorno al massimo. Se utilizzate del guanciale non pepato completate il piatto con pepe macinato a piacere.', NULL, 'La pasta alla gricia è un tipico primo piatto della cucina laziale a base di guanciale e Pecorino. Scopri dosi e ricetta per prepararla a casa tua!', '2024-11-27', 'Pasta alla gricia', 9),
	(8, '2024-11-22 10:03:20.868774', '2024-11-25 11:00:33.929795', 'Lo zafferano è una spezia antica che si ricava dagli stigmi del fiore omonimo. In principio veniva utilizzato per le sue proprietà coloranti ma col tempo è diventato un ingrediente pregiato con cui si possono realizzare ricette indimenticabili… come il risotto allo zafferano! Questo classico primo piatto è tipico della cucina lombarda dove viene spesso abbinato all’ossobuco, ma è amato in tutte le regioni d’Italia: dai grandi e dai piccoli, dai palati più raffinati a quelli più veraci. Il motivo sta nella semplicità della preparazione e nella magia dorata dello zafferano, che impreziosisce i chicchi di riso con il suo aroma e colore inconfondibile. Per un sapore più intenso vi consigliamo di scegliere i pistilli, ma se preferite andrà benissimo anche lo zafferano in polvere. Come ogni risotto che si rispetti, inoltre, sarà fondamentale la fase della mantecatura per ottenere la cremosità ideale, né troppo brodosa né troppo densa. Se avete sempre voluto sapere come si prepara un risotto allo zafferano perfettamente all’onda, quindi, non vi resta che seguire la ricetta!', NULL, 'Il risotto allo zafferano, conosciuto anche come risotto alla milanese, è un primo piatto semplice ma al tempo stesso prelibato! Scopri la ricetta.', '2024-11-27', 'Risotto allo zafferano', 8),
	(10, '2024-11-22 10:15:22.708331', '2024-11-27 10:42:42.717159', 'Basta nominarla perché a tavola ci sia un\'ovazione. E\' la regina dei piatti unici, la consolatrice di umori avviliti: la parmigiana di melanzane. Una ricetta condivisa e contesa come origini da nord a sud: Emilia Romagna, Campania (Parmigiana \'e mulignane) e Sicilia (Parmiciana o Patrociane) con alcune varianti di ingredienti e modalità di composizione, ma tutte assolutamente favolose! Vi siete mai chiesti perché si chiami così? Il nome \'parmigiana\' deriverebbe proprio dal siciliano \'parmiciana\', che in dialetto indica la pila di listelle di legno delle persiane: pensate infatti a come vengono disposte le fette di melanzane in teglia e noterete le similitudini. Pochi ingredienti come pomodoro, melanzane fritte, basilico e mozzarella, e tanto sapore per un piatto simbolo della cucina mediterranea.', NULL, 'La parmigiana di melanzane è una delle ricette italiane più famose e amate. Scopri qui dosi e procedimento per preparare a casa tua la nostra.', '2024-11-27', 'Parmigiana di melanzane', 8),
	(11, '2024-11-28 10:00:24.208221', '2024-11-28 10:00:24.208221', 'Per preparare gli spaghetti allo scoglio cominciate dalla pulizia di cozze e vongole. Queste ultime dovrete sciacquarle più volte sotto acqua corrente 1 e poi farle stare in ammollo in acqua fredda. Intano pulite le cozze: raschiate via le impurità più resistenti con la lama di un coltellino, strappate via il bisso, cioè la parte barbetta che fuoriesce 2, poi aiutatevi con una paglietta d’acciaio nuova pulite bene il guscio ', NULL, 'Esistono innumerevoli versioni di questa prelibatezza: noi vi proponiamo la nostra, con vongole, cozze e scampi prelibat', '2024-11-29', 'Linguine allo scoglio', 7),
	(12, '2024-12-02 11:00:00.000000', '2024-12-02 11:00:00.000000', 'Prepariamo una gustosa pizza Margherita fatta in casa. Con pochi ingredienti: pomodoro, mozzarella, basilico fresco e un impasto perfetto.', NULL, 'La pizza simbolo dell\'Italia, facile da preparare anche a casa.', '2024-12-02', 'Pizza Margherita', 44),
	(38, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Pasta all\'uovo, ragù alla bolognese, parmigiano Reggiano, burro. Preparazione: Cuocere la pasta al dente, saltare nel ragù, mantecare con burro e parmigiano. Servire.', NULL, 'Un classico della cucina italiana, la pasta al ragù è un piatto comfort food perfetto per una cena in famiglia.', '2023-11-28', 'Pasta al Ragù', 4),
	(39, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Pollo, limone, rosmarino, olio extravergine di oliva. Preparazione: Marinare il pollo con limone e rosmarino, cuocere in forno o alla griglia. Servire con patate arrosto o verdure grigliate.', NULL, 'Un piatto semplice e gustoso, il pollo al limone è perfetto per una cena veloce.', '2023-11-28', 'Pollo al Limone', 8),
	(40, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Salmone, spinaci, panna, burro, noce moscata. Preparazione: Cuocere il salmone, saltare gli spinaci, preparare una salsa con panna, burro e noce moscata. Assemblare e servire.', NULL, 'Un piatto leggero e salutare, il salmone con gli spinaci è perfetto per una cena dietetica.', '2023-11-28', 'Salmone con Spinaci', 44),
	(41, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Bistecca di manzo, sale, pepe, olio extravergine di oliva. Preparazione: Cuocere la bistecca a piacere, condire con sale, pepe e olio. Servire con patate al forno o verdure grigliate.', NULL, 'Un piatto classico e gustoso, la bistecca di manzo è perfetta per una cena gourmet.', '2023-11-28', 'Bistecca di Manzo', 4),
	(42, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Pasta sfoglia, ricotta, spinaci, parmigiano Reggiano, noce moscata. Preparazione: Stendere la pasta sfoglia, farcire con ricotta, spinaci, parmigiano e noce moscata. Chiudere e cuocere in forno.', NULL, 'Un piatto sfizioso e veloce, la torta salata con spinaci e ricotta è perfetta per un aperitivo o una cena leggera.', '2023-11-28', 'Torta Salata con Spinaci e Ricotta', 9),
	(43, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Zucchine, pangrattato, parmigiano Reggiano, aglio, olio extravergine di oliva. Preparazione: Tagliare le zucchine a rondelle, impanarle con pangrattato e parmigiano, friggere in olio caldo. Servire con aglio e olio.', NULL, 'Un piatto tipico della cucina italiana, le zucchine fritte sono perfette come antipasto o contorno.', '2023-11-28', 'Zucchine Fritte', 1),
	(44, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Melanzane, pomodoro, basilico, mozzarella, parmigiano Reggiano. Preparazione: Tagliare le melanzane a fette, grigliarle, assemblare con pomodoro, basilico, mozzarella e parmigiano. Infornare.', NULL, 'Una versione light della parmigiana di melanzane, perfetta per chi vuole mantenersi in forma.', '2023-11-28', 'Parmigiana di Melanzane Light', 44),
	(46, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Riso Carnaroli, funghi porcini, brodo vegetale, burro, parmigiano Reggiano, vino bianco. Preparazione: Tostare il riso, sfumare con il vino, aggiungere il brodo a mestoli, mantecare con burro e parmigiano.', NULL, 'Un piatto autunnale e saporito, il risotto ai funghi porcini è perfetto per una cena in famiglia.', '2023-11-28', 'Risotto ai Funghi Porcini', 7),
	(47, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Pollo, curry, latte di cocco, riso basmati. Preparazione: Marinare il pollo con il curry, cuocere in padella con il latte di cocco. Servire con riso basmati.', NULL, 'Un piatto esotico e saporito, il pollo al curry è perfetto per una cena diversa dal solito.', '2023-11-28', 'Pollo al Curry', 7),
	(48, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Salmone, avocado, rucola, limone, olio extravergine di oliva. Preparazione: Tagliare il salmone a cubetti, l\'avocado a fettine, condire con rucola, limone e olio. Servire su crostini di pane.', NULL, 'Un piatto elegante e raffinato, la tartare di salmone è perfetta per un aperitivo o un antipasto.', '2024-10-10', 'Tartare di salmone', 3),
	(49, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: \r\n* 1 melanzana\r\n* 1 zucchina\r\n* 1 peperone rosso\r\n* 1 cipolla\r\n* 2 spicchi d\'aglio\r\n* Pomodorini ciliegino\r\n* Olio extravergine d\'oliva\r\n* Basilico fresco\r\n* Sale e pepe\r\n* Pasta integrale \r\nPreparazione: \r\n1. Cuoci la pasta in abbondante acqua salata. \r\n2. Nel frattempo, taglia le verdure a cubetti e soffriggi in padella con olio, aglio e cipolla. \r\n3. Aggiungi i pomodorini e cuoci per circa 15 minuti. \r\n4. Scola la pasta al dente e condisci con il sugo di verdure. \r\n5. Completa con basilico fresco a piacere.', NULL, 'Un piatto leggero e gustoso, perfetto per chi cerca un\'alternativa vegetariana alla pasta tradizionale. Le verdure fresche e colorate lo rendono un piatto sano e invitante.', '2023-11-28', 'Pasta con verdure tricolore', 7),
	(50, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Riso Carnaroli, zucca, salsiccia, cipolla, brodo vegetale, burro, parmigiano, rosmarino. Preparazione: Tosta il riso, soffriggi cipolla e salsiccia sbriciolata, aggiungi la zucca a dadini, sfuma con vino bianco, prosegui la cottura con il brodo, manteca con burro, parmigiano e rosmarino.', NULL, 'Un classico autunnale, il risotto alla zucca e salsiccia è un piatto caldo e confortante.', '2023-11-28', 'Risotto alla zucca e salsiccia', 44),
	(51, '2023-11-28 18:00:00.000000', '2023-11-29 18:00:00.000000', 'Ingredienti: Lenticchie rosse, pangrattato, cipolla, prezzemolo, uovo, parmigiano, pangrattato per impanare, olio per friggere. Preparazione: Lessa le lenticchie, frullale con gli altri ingredienti, forma le polpette, impanale e friggi.', NULL, 'Un\'alternativa vegetariana alle classiche polpette di carne.', '2023-11-28', 'Polpette di lenticchie', 4),
	(52, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Carote, uova, farina, zucchero, olio, lievito, cannella. Preparazione: Grattugia le carote, monta le uova con lo zucchero, aggiungi gli altri ingredienti e cuoci in forno.', NULL, 'Una torta soffice e umida, perfetta per la colazione o la merenda.', '2023-11-28', 'Torta di carote', 4),
	(53, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Farro perlato, melanzane, zucchine, peperoni, cipolla, olio, aceto balsamico, sale, pepe. Preparazione: Cuoci il farro, griglia le verdure, condisci tutto con olio, aceto e spezie.', NULL, 'Un piatto fresco e leggero, ideale per l\'estate.', '2023-11-28', 'Insalata di farro e verdure grigliate', 44),
	(54, '2023-11-28 18:00:00.000000', '2023-11-28 18:00:00.000000', 'Ingredienti: Lasagne, besciamella, passata di pomodoro, melanzane, zucchine, mozzarella, parmigiano. Preparazione: Cuoci le lasagne, prepara la besciamella, cuoci le verdure, assembla le lasagne con strati alternati e cuoci in forno.', NULL, 'Un classico rivisitato in chiave vegetariana, perfetto per una cena speciale.', '2023-11-28', 'Lasagne vegetariane', 7),
	(55, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Pasta alla Norma è un piatto tradizionale siciliano con melanzane fritte, salsa di pomodoro, basilico e ricotta salata.', NULL, 'Deliziosa pasta con melanzane fritte e salsa di pomodoro.', '2024-12-02', 'Pasta alla Norma', 44),
	(56, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Pollo alla cacciatora: succulento pollo cotto con pomodori, cipolle, carote, vino rosso e erbe aromatiche.', NULL, 'Pollo succulento cotto con verdure e vino rosso.', '2024-12-02', 'Pollo alla Cacciatora', 9),
	(57, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Lasagne alla Bolognese: un piatto di pasta al forno fatto con strati di ragù, besciamella e sfoglie di pasta fresca.', NULL, 'Classiche lasagne con ragù alla bolognese.', '2024-12-02', 'Lasagne alla Bolognese', 8),
	(58, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Insalata Caprese con mozzarella di bufala, pomodori freschi, basilico, olio extravergine di oliva e aceto balsamico.', NULL, 'Rinfrescante insalata Caprese con mozzarella di bufala.', '2024-12-01', 'Insalata Caprese', 9),
	(59, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Gnocchi al Pesto: morbidi gnocchi di patate conditi con un pesto di basilico fatto in casa, pinoli, Parmigiano e aglio.', NULL, 'Gnocchi di patate con pesto di basilico fatto in casa.', '2024-12-02', 'Gnocchi al Pesto', 7),
	(60, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Vitello Tonnato: fettine di vitello servite fredde con una salsa cremosa a base di tonno, maionese, capperi e acciughe.', NULL, 'Fettine di vitello con salsa tonnata cremosa.', '2024-11-02', 'Vitello Tonnato', 44),
	(61, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Frittata di Zucchine: una semplice frittata fatta con uova, zucchine fresche, cipolla e Parmigiano Reggiano.', NULL, 'Semplice frittata con zucchine e Parmigiano.', '2024-12-02', 'Frittata di Zucchine', 9),
	(62, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Ossobuco alla Milanese: tenero ossobuco di vitello cotto in una salsa di pomodoro, vino bianco e brodo, servito con gremolata.', NULL, 'Tenero ossobuco di vitello con gremolata.', '2024-12-02', 'Ossobuco alla Milanese', 7),
	(63, '2024-12-02 14:14:12.000000', '2024-12-02 14:14:12.000000', 'Crostata di Frutta: base di pasta frolla con crema pasticcera e frutta fresca di stagione.', NULL, 'Crostata con crema pasticcera e frutta fresca.', NULL, 'Crostata di Frutta', 9),
	(83, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 200g di pasta \n- 100g di pancetta \n- 1 cipolla \n- 200ml di panna\n\nPreparazione: \n1. Cuocere la pasta. \n2. Soffriggere la cipolla e la pancetta. \n3. Unire la panna e aggiungere la pasta cotta.', NULL, 'Un classico piatto italiano, facile e veloce da preparare.', '2024-12-02', 'Pasta alla Panna e Pancetta', 8),
	(84, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 1kg di manzo \n- 2 cipolle \n- 3 carote \n- 2 pomodori \n- 300ml di brodo\n\nPreparazione: \n1. Rosolare il manzo. \n2. Aggiungere le verdure tritate. \n3. Versare il brodo e cuocere a fuoco lento per 2 ore.', NULL, 'Uno stufato di manzo ricco e saporito.', '2024-12-02', 'Stufato di Manzo', 4),
	(85, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 200g di farina \n- 100g di zucchero \n- 3 uova \n- 100g di burro \n- 100g di cioccolato fondente\n\nPreparazione: \n1. Mescolare tutti gli ingredienti. \n2. Versare l\'impasto in una teglia. \n3. Infornare a 180°C per 30 minuti.', NULL, 'Un dolce semplice e delizioso.', '2024-12-02', 'Torta al Cioccolato', 4),
	(86, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 200g di spaghetti \n- 2 zucchine \n- 100g di ricotta \n- Olio d\'oliva\n\nPreparazione: \n1. Cuocere gli spaghetti. \n2. Saltare le zucchine in padella con olio. \n3. Mescolare la pasta con le zucchine e la ricotta.', NULL, 'Un primo piatto leggero e saporito.', '2024-12-02', 'Spaghetti con Zucchine e Ricotta', 7),
	(87, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 500g di patate \n- 100g di formaggio grattugiato \n- 50g di burro \n- Latte q.b.\n\nPreparazione: \n1. Lessare le patate e schiacciarle. \n2. Aggiungere burro, formaggio e latte. \n3. Mescolare fino a ottenere un purè cremoso.', NULL, 'Un contorno classico che piace a tutti.', '2024-12-02', 'Purè di Patate', 8),
	(88, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 4 filetti di pesce \n- 1 limone \n- Olio d\'oliva \n- Erbe aromatiche\n\nPreparazione: \n1. Cuocere il pesce in padella con olio. \n2. Spremere il limone sui filetti. \n3. Guarnire con erbe aromatiche.', NULL, 'Un secondo di pesce semplice e gustoso.', '2024-12-02', 'Filetti di Pesce al Limone', 7),
	(89, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 200g di pasta \n- 100g di pesto \n- 1 patata \n- 50g di fagiolini\n\nPreparazione: \n1. Cuocere la pasta con la patata e i fagiolini. \n2. Condire con il pesto.', NULL, 'Un classico della cucina ligure.', '2024-12-02', 'Pasta al Pesto con Patate e Fagiolini', 8),
	(90, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 200g di riso \n- 100g di piselli \n- 50g di prosciutto cotto \n- 1 carota\n\nPreparazione: \n1. Cuocere il riso. \n2. Aggiungere piselli, prosciutto e carota a dadini. \n3. Saltare in padella per qualche minuto.', NULL, 'Un primo piatto rapido e saporito.', '2024-12-02', 'Riso con Piselli e Prosciutto', 9),
	(91, '2024-12-02 14:39:24.000000', '2024-12-02 14:39:24.000000', 'Ingredienti: \n- 3 uova \n- 100g di zucchero \n- 300ml di latte \n- Caramello q.b.\n\nPreparazione: \n1. Mescolare uova, zucchero e latte. \n2. Versare il composto in uno stampo con caramello. \n3. Cuocere a bagnomaria per 40 minuti.', NULL, 'Un dolce al cucchiaio classico e amato.', NULL, 'Crème Caramel', 44),
	(137, '2024-12-02 14:45:34.000000', '2024-12-02 14:45:34.000000', 'Preparazione: 1) Cuocere risotto. 2) Preparare ragù. 3) Formare palline ripiene. 4) Impanare. 5) Friggere in olio bollente.', NULL, 'Celebri polpette di riso ripiene di ragù e piselli', '2024-12-02', 'Arancini Siciliani', 4),
	(138, '2024-12-02 14:45:58.000000', '2024-12-02 14:45:58.000000', 'Ingredienti: melanzane, olive, capperi, sedano, pomodori, aceto. Passaggi: 1) Tagliare verdure. 2) Friggere melanzane. 3) Cuocere verdure in padella. 4) Aggiungere aceto di vino.', NULL, 'Contorno mediterraneo con melanzane, olive e capperi', '2024-12-02', 'Caponata Siciliana', 44),
	(139, '2024-12-02 14:46:13.000000', '2024-12-02 14:46:13.000000', 'Ingredienti: gnocchi, gorgonzola, panna, noci, burro. Procedimento: 1) Cuocere gnocchi. 2) Preparare salsa sciogliendo gorgonzola e panna. 3) Condire gnocchi. 4) Aggiungere noci tritate.', NULL, 'Gnocchi cremosi con salsa di gorgonzola dolce e noci', '2024-12-02', 'Gnocchi al Gorgonzola', 7),
	(140, '2024-12-02 14:46:33.000000', '2024-12-02 14:46:33.000000', 'Ingredienti: polpo, pomodorini, olive, aglio, prezzemolo, olio. Passaggi: 1) Pulire il polpo. 2) Cuocere con pomodorini, olive e aglio. 3) Cuocere a fuoco lento per 40 minuti. 4) Decorare con prezzemolo fresco.', NULL, 'Tradizionale ricetta napoletana di polpo cotto con pomodoro e olive', '2024-12-02', 'Polpo alla Luciana', 9),
	(142, '2024-12-02 16:10:56.000000', '2024-12-02 16:10:56.000000', 'Ingredienti: ceci secchi, rosmarino, pancetta, cipolla, carota, sedano. Passaggi: 1) Ammollare ceci. 2) Preparare soffritto. 3) Aggiungere ceci e brodo. 4) Cuocere lentamente. 5) Guarnire con pancetta croccante.', NULL, 'Zuppa calda e nutriente con ceci, rosmarino e pancetta', '2024-12-02', 'Zuppa di Ceci', 8),
	(143, '2024-12-02 16:11:44.000000', '2024-12-02 16:11:44.000000', 'Ingredienti: zucchine, carote, formaggio fresco, basilico, pasta sottile. Preparazione: 1) Tagliare verdure sottili. 2) Grigliare. 3) Farcire con formaggio. 4) Arrotolare. 5) Servire con salsa leggera.', NULL, 'Rotolini leggeri ripieni di verdure e formaggio fresco', '2024-12-02', 'Involtini Primavera', 44),
	(144, '2024-12-02 16:12:13.000000', '2024-12-02 16:12:13.000000', 'Ingredienti: farina, uova, ricotta, spinaci, noce moscata. Procedimento: 1) Preparare pasta fresca. 2) Preparare ripieno con ricotta e spinaci. 3) Formare ravioli. 4) Cuocere in acqua bollente. 5) Condire con burro e salvia.', NULL, 'Pasta fresca ripiena con ricotta e spinaci', '2024-12-02', 'Ravioli di Ricotta e Spinaci', 4),
	(145, '2024-12-02 16:12:36.000000', '2024-12-02 16:12:36.000000', 'Ingredienti: uova, asparagi, parmigiano, cipollotti. Preparazione: 1) Tagliare asparagi. 2) Sbattere uova. 3) Cuocere asparagi in padella. 4) Aggiungere uova. 5) Completare cottura in forno.', NULL, 'Frittata leggera con asparagi freschi e parmigiano', NULL, 'Frittata di Asparagi', 9),
	(146, '2024-12-02 16:13:35.000000', '2024-12-02 16:13:35.000000', 'Ingredienti: cavatelli, broccoli, aglio, peperoncino, olio. Passaggi: 1) Cuocere broccoli. 2) Preparare soffritto di aglio. 3) Cuocere pasta. 4) Saltare insieme con olio e peperoncino.', NULL, 'Pasta tradizionale pugliese con broccoli e peperoncino', '2024-12-02', 'Cavatelli con Broccoli', 44),
	(147, '2024-12-02 16:13:35.000000', '2024-12-02 16:13:35.000000', 'Ingredienti: melanzane, ricotta, spinaci, prosciutto cotto. Preparazione: 1) Grigliare melanzane. 2) Preparare ripieno. 3) Arrotolare con farcia. 4) Cuocere in forno con sugo.', NULL, 'Rotolo ripieno di ricotta, spinaci e prosciutto', '2024-12-02', 'Rotolo di Melanzane', 7),
	(148, '2024-12-02 16:13:35.000000', '2024-12-02 16:13:35.000000', 'Ingredienti: farina, burro, ricotta, zucchero, scorza di limone. Procedimento: 1) Preparare pasta frolla. 2) Preparare crema di ricotta. 3) Stendere pasta. 4) Riempire con crema. 5) Cuocere in forno.', NULL, 'Dolce classico con pasta frolla e ripieno cremoso', '2024-12-02', 'Crostata di Ricotta', 8),
	(149, '2024-12-02 16:13:35.000000', '2024-12-02 16:13:35.000000', 'Ingredienti: quinoa, cetrioli, pomodorini, feta, prezzemolo. Preparazione: 1) Cuocere quinoa. 2) Tagliare verdure. 3) Miscelare ingredienti. 4) Condire con olio e limone.', NULL, 'Insalata leggera e proteica con verdure fresche', '2024-12-02', 'Insalata di Quinoa', 4),
	(150, '2024-12-02 16:13:35.000000', '2024-12-02 16:13:35.000000', 'Ingredienti: pasta per cannelloni, ricotta, spinaci, sugo, parmigiano. Passaggi: 1) Preparare ripieno. 2) Riempire cannelloni. 3) Disporre in teglia. 4) Coprire con sugo. 5) Cuocere in forno.', NULL, 'Pasta ripiena con ricotta, spinaci e sugo di pomodoro', '2024-12-02', 'Cannelloni di Ricotta', 4);
